import React from "react";
import MovieBox from "./MovieBox"

const tempFaves = [
  {id: 1, name: 'Titanic', img: 'images/movies/titanic.jpg' },
  {id: 2, name: 'Scary Movie', img: 'images/movies/scary.jpg' },
  {id: 3, name: 'Jaws', img: 'images/movies/jaws.jpg'},
  {id: 4, name: 'Baby Driver', img: 'images/movies/baby.jpeg' },
]

export default function List(props) {
  let boxes = [];
  for (let x = 0; x < 10; x++) {
    if (tempFaves.length > x) { 
      boxes.push(<MovieBox name={tempFaves[x]['name']} img={tempFaves[x]['img']} />)
    } else {
      boxes.push(<MovieBox name='hi'/>)
    }
  } 

  return (
    <article className="list">{boxes}</article>
  )
}
